import React, { useEffect, useState } from 'react'
import Drawn from './Drawn'

export default function Dragonfly() {
  const [drawn, setDrawn] = useState({ cards: [] })

  useEffect(() => {
    const fetchData = async () => {
      const data = await fetch('http://localhost:3000/spreads/dragonfly')
      setDrawn(data)
      debugger
    }
    fetchData()
  }, [])

  return (
    <div>
      {drawn.cards}
    </div>
  )
}
